def sum_array(a, b):
	i_a = len(a)-1
	i_b = len(b)-1
	
	if(len(a) < len(b)):
		a_aux = a
		a = b
		b = a_aux

		i_aux = i_a
		i_a = i_b
		i_b = i_aux

	c = [None] * (i_a+2)
	i_c = len(a)
	aux = 0

	while(i_a >= 0):
		suma = a[i_a]+aux
		if(i_b >= 0):
			suma += b[i_b]

		c[i_c] =  suma % 10
		aux = int(suma / 10 )

		i_a -= 1
		i_b -= 1
		i_c -= 1

	c[i_c] = aux

	return c

